import React from "react";

const title = props => {
  return (
    <div
    //   class="carousel-item active"
    // style="background-image: url('https://behesht.me/img/slider/bg-3.jpg')"
    // style={{
    //   backgroundImage: "url('https://behesht.me/img/slider/bg-3.jpg')"
    // }}
    >
      <div class="carousel-caption text-center">
        <h3
          //   class="wow fadeInDown animated"
          //   data-wow-delay="0.3s"
          style={{
            visibility: "visible",
            WebkitAnimationDelay: "0.3s",
            MozAnimationDelay: "0.3s",
            animationDelay: "0.3s"
          }}
          //   style={{visibility: "visible",-webkit-animation-delay: "0.3s", -moz-animation-delay: "0.3s", animation-delay: "0.3s";}}
        >
          راهِ هموارِ بهشت
        </h3>
        <h2
          //   class="wow bounceIn animated"
          data-wow-delay="0.6s"
          //   style="visibility: visible;-webkit-animation-delay: 0.6s; -moz-animation-delay: 0.6s; animation-delay: 0.6s;"
          style={{
            visibility: "visible",
            WebkitAnimationDelay: "0.6s",
            MozAnimationDelay: "0.6s",
            animationDelay: "0.6s"
          }}
        >
          از آغاز تا پایان جذب موفق مشارکت&zwnj;های مردمی با شما هستیم.
        </h2>
        <h4
          //   class="wow fadeInUp animated"
          //   data-wow-delay="0.9s"
          //   style="visibility: visible;-webkit-animation-delay: 0.9s; -moz-animation-delay: 0.9s; animation-delay: 0.9s;"
          style={{
            visibility: "visible",
            WebkitAnimationDelay: "0.9s",
            MozAnimationDelay: "0.9s",
            animationDelay: "0.9s"
          }}
        >
          فضای آنلاین، مسیر برداشت سرمایه&zwnj;های خرد را برای شما هموار
          می&zwnj;کند.
        </h4>
      </div>
    </div>
  );
};

export default title;
